        const uint32_t q_15__N_15_lo = q_15__N_15;
        c_31 += ul32_addc(&c_30, &c_30, &q_15__N_15_lo);
        const uint32_t q_15__N_14_hi = q_15__N_14 >> 32;
        c_31 += ul32_addc(&c_30, &c_30, &q_15__N_14_hi);
        const uint32_t q_16__N_14_lo = q_16__N_14;
        c_31 += ul32_addc(&c_30, &c_30, &q_16__N_14_lo);
        const uint32_t q_16__N_13_hi = q_16__N_13 >> 32;
        c_31 += ul32_addc(&c_30, &c_30, &q_16__N_13_hi);
        
